import React from "react";
import { Canvas } from "@react-three/fiber";
import "./App.scss";
import Scene from "./components/Scene/Scene";
import Home from "./components/Home/Home";
const App = () => {
  return (
    <>
      <Suspense>
        <Canvas
          linear
          orthographic
          colorManagement
          dpr={[1, 1.5]}
          gl={{
            antialias: true,
          }}
        >
          <Scene />
        </Canvas>
      </Suspense>

      <Home />
    </>
  );
};

export default App;
